import React from "react";

function List({contacts}){
    return(
        <div>
            <input placeholder="Filter"></input>

            <ul>
            {
                contacts.map((contact, i) => <li key={i}>{contact.fullName}{contact.phoneNumber}</li>)
            }
            </ul>
        </div>
    )
}

export default List
